        const SKU = products[Math.floor(Math.random() * products.length)];
        return `${SKU}`;
    }
    // Function to generate a random number within a range
    function generateRandomNumber(min, max) {
        return Math.floor(Math.random() * (max - min + 1)) + min;
    }

    // Generate random data
    const productQuantity = generateRandomNumber(1, 100);
    const total = generateRandomNumber(10, 1000);
    const sku = generateProductId();

    // Create JSON object
    const data = {
       "content": 'The price of the product ' + sku + ' is $' + total ,
        "log.source": '/var/open/syslog'
    };

    // Convert object to JSON
    const jsonData = JSON.stringify(data);

  // Print JSON to the console
console.log(data)
